    public static int [] mult10toM(int [] u, int m)   {


        int n = u.length+m;
        int[] arr = new int[n];
        int k = m;
        // multiply until u.length
        if(u.length != 0){
            for(int i = 0; i < u.length; i++){
                arr[k] = u[i];
                k++;
            }
            return arr;
        }

        return new int[]{-9999};
    }



    public static int [] div10toM(int [] u, int m)   {


        int n = u.length;
        int k = 0;
        int j = m;
        if(n != 0 && m < n){
            int[] arr = new int[n-m];
            for(int i = m; i < n; i++){
                arr[k] = u[i];
                k++;
            }
            return arr;

        }else if(j <= m){
            return new int[]{0};
        }
        return new int[]{-9999};
    }



    public static int [] mod10toM(int [] u, int m)   {

        int n = u.length;
        if(m == 0){
            return new int[]{0};

        }

        else if(m == 1){
            return new int[]{u[0]};

        }
        // I need mod until u.length
        else if(m > 1 && m <= n){
            int[] arr = new int[m];
            for(int i = 0; i < m; i++){
                arr[i] = u[i];

            }
            return arr;
        }
        //if m is bigger than u.length it returns whatever my array
        else if(m > n){
            return u;

        }
        return new int[]{-9999};
    }


    // make sure to "compress" your array so there are no leading zeros in the return array.
    public static int [] add(int [] u, int [] v)   {


        int n1 = u.length;
        int n2 = v.length;
        int a = 0;
        int k = 0;
        int carry = 0;
        int sum = 0;
        if ( n1 != 0) {
            //I don't know which array.length is larger
            //which one is larger I need to make a+1 array size.
            if (n1 >= n2) {
                a = n1;
            }
            else {
                a = n2;
            }

            int[] arr = new int[a + 1];
            // comparing and adding until both same length
            while (k < n1 && k < n2) {
                sum = u[k] + v[k];

                if (carry == 1) {
                    sum = sum + carry;
                    arr[k] = sum % 10;
                    carry = sum / 10;
                } //3
                else if (sum > 9) {
                    arr[k] = sum % 10;
                    carry = sum / 10;

                }
                else {
                    carry = 0;
                    arr[k] = sum;
                }
                k++;
            }
            //if my v.length is larger than u.length
            //remaining part that I need to add it with carry
            if( k< a && k< n2) {
                if (carry == 1) {
                    for (int i = k; i< a; i++) {
                        sum = v[k]+ carry;
                        if( sum > 9) {
                            arr[k] = sum %10;
                            carry = sum /10;
                        } //14
                        else {
                            arr[k] = sum;
                            carry= 0;
                        } //15
                        k++;
                    } //16
                } //17

                else{
                    //copy the rest of []v's vale if there is no carry
                    for (int i = k; i< a; i++) {
                        arr[k] = v[k];
                        k++;
                    }
                }

            }
            //if my u length bigger than v length with carry value
            //I need to add that carry and copy of ther rest value in my new array.
            if( k< a && k< n1) {
                if (carry == 1) {
                    for (int i = k; i< a; i++) {//left element of u
                        sum = u[k]+ carry;
                        if( sum > 9) {
                            arr[k] = sum %10;
                            carry = sum /10;
                        }
                        else {
                            arr[k] = sum;
                            carry= 0;
                        }
                        k++;
                    }
                }

                else{
                    //copying the rest of [] u's value without carry
                    for (int i = k; i< a; i++) {
                        arr[k] = u[k];
                        k++;
                    }
                }

            }

            //when is my value carry 1 to the last index I need to put in that index.
            if (carry == 1 && k+1 == arr.length) {
                arr[k] = 1;
            }


            return compress(arr);
        }
        return new int[]{-9999};

    }



    // make sure to "compress" your array so there are no leading zeros in the return array.
    public static int [] subtract(int [] u, int [] v)   {


        int n1 = u.length;
        int n2 = v.length;
        int k = 0;

        int val = 0;
        int carry = 0;
        int sub = 0;

        if (n1 != 0) {

            int[] arr = new int[n1 + 1];
            while (k < n1 && k < n2) {
                val = u[k] - carry;

                if (val < v[k]) {
                    if (val == -1) {
                        sub = val + 10;
                        carry = sub / 9;
                        arr[k] = sub - v[k];
                        k++;
                    } else {
                        sub = val + 10;
                        carry = sub / 10;
                        arr[k] = sub - v[k];
                        k++;
                    }
                }
                else {
                    arr[k] = val - v[k];
                    carry = 0;
                    k++;
                }
            }

            if (k < n1) {
                //copying the remaing part of u array to my new arr[] array
                for (int i = k; i < n1; i++) {
                    //this is applies when many 0 to subtract with other number
                    if (carry == 1 && u[k] == 0) {
                        sub = 10 - carry;
                        carry = sub / 9;
                        arr[k] = sub;
                        k++;
                    } else if (carry == 1) {
                        arr[k] = u[k] - 1;
                        carry = 0;
                        k++;
                    } else {
                        arr[k] = u[i];
                        k++;
                    }
                }
            }
            return compress (arr);

        }
        return new int[]{-9999};


    }


    // This method makes 8 recursive calls
    public static int [] prod(int [] u, int [] v)   {

        int n = Math.max(u.length, v.length);

        if (n == 1)
            return baseCaseProduct(u, v);

        else if(n > 1) {

            int m = n/2;

            int []x = div10toM(u,m);
            int []y = mod10toM(u,m);
            int []w = div10toM(v,m);
            int []z = mod10toM(v,m);

            int[] P1 = prod(x,w);
            int[] P2 = prod(x,z);


            int[] P3 = prod(w,y);


            int[] P4 = prod(y,z);

            //multiply

            int[] M1 =  mult10toM(P1,2*m);//MULT
            int[] A1 = add(P2,P3);//ADD
            int[] M2 =  mult10toM(A1,m);//MULT
            //ADDING
            int[] A2 = add(M1, M2);//ADDING 1ST AND 2ND
            int[]A3 = add(A2,P4);

            return A3;


        }


        return new int[]{-9999};
    }



    // This method makes 7 recursive calls
    public static int [] prod2(int [] u, int [] v)   {

        int n = Math.max(u.length, v.length);

        if (n == 1)
            return baseCaseProduct(u, v);

        else if(n > 1){
            int m = n/2;

            int[] x = div10toM(u,m);
            int[] y = mod10toM(u,m);
            int[] w = div10toM(v,m);
            int[] z = mod10toM(v,m);
            //returning individual array that i can easily understand
            //instead of writing one single line
            int[] A1 = add(x,y);

            int[] A2 = add(w,z);

            int[] r = prod2(A1,A2);

            int[] p = prod2(x,w);

            int[] q = prod2(y,z);
            int[] M1 = mult10toM(p,2*m);

            int[] S1 = subtract(r,p);

            int[] S2 = subtract(S1,q);
            int[] M2 = mult10toM(S2,m);

            int[] A3 = add(M1,M2);
            int[] A4 = add(A3,q);

            return A4;

        }


        return new int[]{-9999};
    }






