    // baseCaseProduct handles the case where u and v both have length 1 (i.e. single digits)
    public static int [] baseCaseProduct(int [] u, int [] v)  {

        int p = u[0] * v[0];

        if (p < 10) {
            int [] a = {p};
            return a;
        }

        else {
            int [] a = {p % 10, p / 10};
            return a;
        }
    }

    // compress removes any leading zeros
    public static int [] compress(int [] a)  {

        int i = a.length - 1;

        while (i > 0 && a[i] == 0)
            i--;

        int [] b = new int[i+1];

        for (int j = 0; j <= i; j++)
            b[j] = a[j];

        return b;
    }



