    public static int [] toArray(String s)  {

        int [] a = new int[s.length()];

        for (int i = 0; i < a.length; i++)
            a[a.length - 1 - i] = s.charAt(i) - '0';

        return a;
    }

    public static String toString(int [] a)  {

        String s = "";
        for (int i = 0; i < a.length; i++)
            s = a[i] + s;
        return s;
    }






